import Profile from './Profile';
import TopBanner from './TopBanner';

import { Container, Row, Col } from 'react-bootstrap';


function Home() {
    return (
        <div id="home" className="home">
        <Container className="m-auto">
                <Row>
                <TopBanner />
                </Row>
        </Container>
        <Container>
                <Row>
                    <Col sm={10}>vfvs</Col>
                    <Col sm={2}  >dfsvsdv</Col>
                </Row>
        </Container>

        <Profile />

        </div>
    )
}

export default Home
